    print("[*] Searching for readable flag...")
    
    def decode_bits(bit_list, lsb=True, step=8):
        chars = ""
        for i in range(0, len(bit_list), step):
            chunk = bit_list[i:i+step]
            if len(chunk) < step: break
            s = "".join(map(str, chunk))
            if lsb: s = s[::-1]
            chars += chr(int(s, 2))
        return chars

